import React from "react";

const Trailer = (props) => {
  let youtubeUrl = `https://www.youtube.com/embed/${props.trailer}`;
  return (
    <div className="iframe">
      <embed
        style={{ width: "580px", height: "350px" }}
        frameBorder="0"
        type="video/webm"
        src={youtubeUrl}
      />
      <iframe
        frameBorder="0"
        scrolling="no"
        marginHeight="0"
        marginWidth="0"
        width="623"
        height="350"
        type="text/html"
        src="https://www.youtube.com/embed/DBXH9jJRaDk?autoplay=1&fs=1&iv_load_policy=3&showinfo=0&rel=1&cc_load_policy=0&start=0&end=0&origin=https://youtubeembedcode.com"
      >
        <div>
          <small>
            <a href="https://youtubeembedcode.com/en/">youtubeembedcode en</a>
          </small>
        </div>
      </iframe>
    </div>
  );
};

export default Trailer;
